import './index.css';

class ModeEvaluationApp extends Component {

  constructor(props) {
    super(props);
    this.state = {
      project_capital_investment: 0, // 项目资金投入
      project_importance: 0, // 项目重要程度
      project_effectiveness_evaluation_results: 0, // 项目成效评价结果

      project_completion_degree: 0, // 所评价项目的规定时间完成程度
    };
  }

  render() {
    return (
      <div className="mode-evaluation-container w-100 h-100">

      </div>
    );
  }
}

export default ModeEvaluationApp;
